style.css:
@-moz-document domain("vaultproject.io") {
body,
#main-content {
    background-color: #282a2e;
    color: #e0e0e0;
}
#header .row .col-md-offset-1,
#header .row .col-md-offset-1 a,
#footer .row a {
   color: #e0e0e0;
}
.docs-sidebar .nav.docs-sidenav li.active a {
   color: #e0e0e0 !important;
}
.edit-page-link a {
    color: #e0e0e0;
}
.bs-docs-section h1,
.bs-docs-section h2,
.bs-docs-section h3,
.bs-docs-section h4,
.bs-docs-section h5,
.bs-docs-section h6 {
    color: #fff;
}
code {
    background: #333;
}
.alert-warning {
    background-color: #666;
    color: #e0e0e0;
}
}
